static int recuperer_zero(char * sortie,char * entree,int size)
    {
                  int k=0;
                  int n=0;
                  for (int i = 0; i<=size;i++)
                    {
                      sortie[k] = entree[i];

                      if ((entree[i]=='\x01')&&(entree[i+1]=='\x03')&&(entree[i+2]=='\x01')&&(i<=size-2))
                        {
                          sortie[k]='\x00';

                          i= i+2;
                          n=n+2;

                        }
                       k++;
                    }
                  return n;
    }

